import { combineEpics } from 'redux-observable';
import {
  retrieveEventsEpic,
  storeEventsEpic,
  beginStoreEventsEpic,
} from './db/events';
import {
  beginGetEventsEpics
} from './events';
import {
  beginGoogleAuthEpic
} from './auth';

export const rootEpic = combineEpics(
  //beginGoogleAuthEpic,
  retrieveEventsEpic,
  storeEventsEpic,
  beginStoreEventsEpic,
  beginGetEventsEpics
);
